import React from 'react';
import TimeCard from './component/TimeCard';
import ProfileCard from './component/ProfileCard';

class App extends ReactComponent {

  render() { 
    return (
      <div className="container-fluid"> 
        <div className="row">
          <div className="col-lg-3 col-12">
            <ProfileCard />
          </div>

          <div className="col-lg-3 col-12">
            <TimeCard /></div>

          <div className="col-lg-3 col-12">
            <TimeCard /></div>

          <div className="col-lg-3 col-12">
            <TimeCard /></div>

        </div>

      </div>
    );
  }
}





export default App;
